import React from 'react'

const Fetchers = async (dataSet: { teamList: any }) => {

    await fetch('http://localhost:9091/teaminfo', {
        method: 'GET'})
    .then(res => res.json())
    .then(data => {
        dataSet.teamList = data["Value"]
    })

    return dataSet.teamList
}

export default Fetchers
